    description: "\nAddress\n\nHouse 190 Street 90, F.E.C.H.S. FECHS E 11/3 E-11, Islamabad, Islamabad Capital Territory, Pakistan.\n\n\n\nAbout Us\n\nDown Syndrome Club is a student based organisation. It was recently founded by a girl who has a sister with down syndrome. Living in Islamabad, she felt the lack of specialized facilities and a strong support system available for people with Down Syndrome and their families.Down Syndrome Club's goal is to establish an exclusive Down Syndrome center in the capital city of Pakistan.Down Syndrome Club aims to spread love and awareness about Down Syndrome in the country and provide various facilities for people with Down Syndrome, their families and friends to help them live a positive and healthy life.\n\nOur facilities include:\n* Interactive Events.\n* Support Group / Club's Membership.\n* Workshops for Parents and General Public.\n* Speech Therapy.\n* Medical Facilities\n* Occupational Therapy.\n* Individual, Family Counselling and much more.",
