    description: "\nAddress\n\nUmeed-e-Noor, Street 2، H 8/1 H-8, Islamabad, Islamabad Capital Territory, Pakistan.\n\n\n\nAbout Us\n\nUmeed-e-Noor, center for special children,committed to the welfare of special needs children with mental and physical disabilities.Umeed-e-Noor, center for special children established in 1996, a non-profit organization committed to the welfare of special needs children with mental and physical disabilities.Umeed-e-Noor aims to equip physically and mentally challenged children with skills required to lead independent and relatively normal lives. With increase in the number of children with each passing year, the organization has been making provisions for the needy. The facility is run by efficient and trained staff members including speech therapist, physiotherapist, teachers and other support staff. We are currently catering to 65 day scholars and 19 boarders with Cerebral Palsy, Mental Retardation, Down syndrome, Austin, Microcephaly, Developmental Delay and children who fall into the category of Slow Learner.\nUmeed-e-Noor provides high quality continuous care, dedicated to the needs of special children and assistance with education and medical support. Their program includes regular schooling, speech therapy, physiotherapy, rehabilitation programs, counselling, day and night boarding facilities and advisory support for parents.\nWith consistent fund raising efforts and the ongoing support of donors, Umeed-e-Noor has managed to expand the housing capacity along with medical and educational facilities. So far over 1800 children have benefitted by UEN.\nLooking forward to seeing you all involved via activities and donations and ever thankful to those who respect and understand the value of light.",
