    description: "\nAddress\n\nKDSP Office 5th Floor, Jason Trade Centre, Shahra-e-Faisal, Karachi, Paksitan.\n\n\n\nAbout Us\n\nThe Karachi Down Syndrome Program (KDSP), a non-profit organization, was launched in March 2014 by a group of concerned parents and passionate individuals who due to limited support and resources available locally, realized a need for a platform of those with Down syndrome. KDSP was formed with the mission to advocate the value, acceptance and inclusion of people with Down syndrome living in Karachi and aims to provide them with the opportunity to lead independent and fulfilling lives.\nKDSP understands the needs of individuals with Down syndrome and their loved ones and so from the moment a family with a child with Down syndrome is introduced to us, KDSP embarks on a journey with the, until they feel empowered, included and equal members of society. We serve as a KASHTI for our Family Network as they navigate the waters of life; carrying them through with our 6 areas of service..",
